class Footer extends Component{
    render() {
        return (
            <Footer>
                <div className="container text-center">Made with&nbsp;
                    <i class="fa fa-heart pulse"></i>
                    <span class="gainlo">&nbsp;by Gainlo
                    </span>
                </div>
            </Footer>
        )

    }

}

export default Footer
